// src/components/StockChart.js
import React, { useState, useEffect, useCallback } from 'react';
import axios from 'axios';
import Chart from 'react-apexcharts';
import { FINNHUB_API_KEY, isInvalidApiKey, CURRENCY_SYMBOL } from '../TradingDataContext'; // Import FINNHUB_API_KEY and helper

// Define options for the chart
const defaultChartOptions = {
    chart: {
        type: 'candlestick',
        height: 350,
        toolbar: {
            show: true,
            tools: {
                download: true,
                selection: true,
                zoom: true,
                zoomin: true,
                zoomout: true,
                pan: true,
                reset: true,
            },
        },
    },
    title: {
        text: 'Candlestick Chart',
        align: 'left'
    },
    xaxis: {
        type: 'datetime',
        labels: {
            formatter: function(val) {
                return new Date(val).toLocaleDateString();
            }
        }
    },
    yaxis: {
        tooltip: {
            enabled: true
        },
        labels: {
            // CORRECTED: Template literal syntax
            formatter: (value) => `${CURRENCY_SYMBOL}${value ? value.toFixed(2) : ''}`
        }
    },
    plotOptions: {
        candlestick: {
            colors: {
                up: '#00B746', // Green for up candles
                down: '#EF403C' // Red for down candles
            }
        }
    },
    tooltip: {
        x: {
            format: 'dd MMM yyyy' // Corrected format, 'yyyy' for full year
        },
        y: {
            formatter: function(val) {
                // CORRECTED: Template literal syntax
                return `${CURRENCY_SYMBOL}${val ? val.toFixed(2) : ''}`;
            }
        }
    }
};

function StockChart({ symbol }) {
    const [series, setSeries] = useState([{ data: [] }]);
    const [loading, setLoading] = useState(true);
    const [chartError, setChartError] = useState(null);
    const [chartOptions, setChartOptions] = useState(defaultChartOptions);

    const fetchHistoricalData = useCallback(async (stockSymbol) => {
        if (!stockSymbol || isInvalidApiKey(FINNHUB_API_KEY)) {
            setChartError("Invalid symbol or Finnhub API Key.");
            setLoading(false);
            setSeries([{ data: [] }]);
            return;
        }

        setLoading(true);
        setChartError(null);
        setSeries([{ data: [] }]); // Clear previous data

        const now = Math.floor(Date.now() / 1000); // Current timestamp in seconds
        // Fetch more data (e.g., 6 months for a better view if free tier allows)
        const sixMonthsAgo = now - (180 * 24 * 60 * 60); // 180 days (approx 6 months) in seconds
        const resolution = 'D'; // 'D' for daily candles

        try {
            // CORRECTED: Template literal syntax for the Finnhub API URL
            const response = await axios.get(
                `https://finnhub.io/api/v1/stock/candle?symbol=${stockSymbol}&resolution=${resolution}&from=${sixMonthsAgo}&to=${now}&token=${FINNHUB_API_KEY}`
            );

            const { c, h, l, o, t } = response.data; // c: close, h: high, l: low, o: open, t: timestamp

            if (response.data.s === 'no_data' || !c || c.length === 0) {
                setChartError(`No historical data found for ${stockSymbol}. This might be due to an invalid symbol, API restrictions, or no data for the requested period.`);
                setSeries([{ data: [] }]);
                return;
            }

            const formattedData = t.map((timestamp, index) => ({
                x: new Date(timestamp * 1000), // Convert timestamp to milliseconds
                y: [o[index], h[index], l[index], c[index]] // [Open, High, Low, Close]
            }));

            setSeries([{ data: formattedData }]);
            setChartOptions(prevOptions => ({
                ...prevOptions,
                title: { text: `${stockSymbol} Candlestick Chart` }
            }));

        } catch (err) {
            console.error("Error fetching historical data:", err);
            setChartError(`Failed to load chart for ${stockSymbol}. Please check your Finnhub API key and try again. Free tier often has limited historical data access (e.g., last 3 months daily, or only 1 month daily).`);
            setSeries([{ data: [] }]);
        } finally {
            setLoading(false);
        }
    }, [isInvalidApiKey, FINNHUB_API_KEY, CURRENCY_SYMBOL]); // CURRENCY_SYMBOL is not used in fetchHistoricalData's logic, but in options.

    useEffect(() => {
        fetchHistoricalData(symbol);
    }, [symbol, fetchHistoricalData]);

    if (loading) {
        return (
            <div className="chart-loading">
                <div className="spinner"></div>
                <p>Loading chart data...</p>
            </div>
        );
    }

    if (chartError) {
        return <p className="message error-message">{chartError}</p>;
    }

    if (series[0]?.data.length === 0) {
        return <p className="message info-message">No chart data available for {symbol}.</p>;
    }

    return (
        <div className="stock-chart-wrapper">
            <Chart
                options={chartOptions}
                series={series}
                type="candlestick"
                height={350}
            />
        </div>
    );
}

export default StockChart;
